    // MARK: 187. Write a function to find all the 10-letter-long sequences (substrings) that occur more than once in a DNA molecule.
    func findRepeatedDnaSequences(s: String) -> [String] {
        var result = [String]
        var set = Set<String>
        var multiOccurence = Set<String>
        if s.characters.count > 10 {
            var ix = 0
            while ix + 10 < s.characters.count {
                let substr = s.startIndex.advancedBy(0 + ix)...s.startIndex.advancedBy(10 + ix - 1)
                if set.contains(substr) {
                    multiOccurence.insert(set)
                } else {
                    set.insert(substr)
                }
                ix+=1
            }
        }
        
        return result
    }
 
    
    func isPalindrome(x: Int) -> Bool {
        var isNegative = x < 0
        
        var xLow = x < 0 ? -x : x
        var xHigh = x < 0 ? -x : x
        
        var digitsCount:Int = Int(log10(Double(xLow)) + 1)
        var msd:Int = Int(pow(10, Double(digitsCount)))
        for (var ix = 0; ix < digitsCount / 2; ix++) {
            if (xHigh / msd != xLow % 10) {
                return false;
            }
            xHigh = xHigh / msd;
            xLow = xLow / 10;
            msd /= 10
        }
        return true
    }
    
    // MARK: 3. Longest Substring Without Repeating Characters
    func lengthOfLongestSubstring(s: String) -> Int {
        
        var maxLen:Int = 0
        var lookup = [Character:Int]()
        var lastUnique:Int = 0
        let slen = s.characters.count
        for (var ix = 0; ix < slen; ix++) {

            let index = s.startIndex.advancedBy(ix)
            if (lookup[s[index]] != nil && lookup[s[index]] >= lastUnique) {
                maxLen = max(maxLen, ix - lastUnique)
                lastUnique = lookup[s[index]]! + 1
            }
            lookup[s[index]] = ix
        }
        maxLen = max(maxLen, s.characters.count - lastUnique)
            
        return maxLen
    }
    
    
    // MARK: 2. Add Two Numbers represented as Linked Lists
    func addTwoNumbers(l1: ListNode?, _ l2: ListNode?) -> ListNode? {
        var result:ListNode? = ListNode(0);
        let dummyHead = result;
        
        var itr1 = l1
        var itr2 = l2
        var carry = 0
        while (itr1 != nil || itr2 != nil) {
            let sum = (itr1?.val ?? 0) +  (itr2?.val ?? 0) + carry
            result?.next = ListNode(sum % 10);
            carry = sum / 10
            result = result?.next
            itr1 = itr1?.next;
            itr2 = itr2?.next;
        }
        
        if carry != 0 {
            result?.next = ListNode(carry)
        }
        
        return dummyHead?.next
    }
    
    // MARK: - 1. Two Sum
    func twoSum(nums: [Int], _ target: Int) -> [Int] {
        
        var myDict:[Int:Int] = Dictionary()
        var results:[Int] = Array()
        
        for var ix = 0; ix < nums.count; ix++ {
            myDict[nums[ix]] = ix
        }
        
        for var ix = 0; ix < nums.count; ix++ {
            let val = target - nums[ix]
            if  myDict[val] != nil && myDict[val] != ix {
                results.append(ix)
                results.append(myDict[val]!)
                return results;
            }
        }
        return results
    }
    
